import React from "react";
import { useEffect } from "react";
import Main from "./main";
import axios from "axios";
import Ei from "./sample";
import { Vt } from "./sample";
import REi from "./result";
import { Res } from "./result";

function Votehere(){
    return(
        <div>
            <Main card={<Ei />} home='/main' votehere='/votehere' page='Votehere'  />

        </div>
    );

}


function Vote(){



    return(
        <div>
            <Main card={<Vt />}  home='/main' votehere='/votehere' page='Votehere'/>
        </div>
    );
}

function Result()
{
    return(
        <div>
            <Main card={<REi />}  home='/main' result='/result' page='Result'/>
        </div>
    ); 
}

function Resultinfo()
{
    return(
        <div>
            <Main card={<Res />}  home='/main' result='/result' page='Result'/>
        </div>
    ); 
}
export default Votehere;
export {Vote}
export {Resultinfo}
export {Result}
